import React from "react";

const About = () => {
  return (
    <div className="h-screen pt-24 ml-10">
      <p className="text-[0.65rem] tracking-[0.5rem] mb-10">ABOUT US</p>
      <p className="text-lg font-semibold name tracking-[0.5rem] mb-24">
        WHO AM I
      </p>
      <p>
        <span className="text-sm">Hi I am Murtadho 'Aaishah</span>A passionate
        frontend developer, that brings creativity and precision to every
        project. With a strong foundation in web technologies, I specialize in
        crafting engaging and user-centric interfaces. My attention to detail,
        combined with a collaborative mindset, allows me to deliver seamless and
        visually appealing digital experiences. Eager to contribute my skills to
        innovative projects and drive the future of web development.
      </p>
      {/* <professionCard /> */}
    </div>
  );
};

export default About;
